CREATE MATERIALIZED VIEW m5 AS SELECT (coalesce(NULL, t_0.c3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)) AS col_0 FROM alltypes1 AS t_0 JOIN m3 AS t_1 ON t_0.c7 = t_1.col_0 WHERE true GROUP BY t_0.c3, t_0.c15 HAVING true;
CREATE MATERIALIZED VIEW m6 AS SELECT t_0.credit_card AS col_0 FROM person AS t_0 WHERE false GROUP BY t_0.date_time, t_0.credit_card, t_0.name HAVING false;
CREATE MATERIALIZED VIEW m7 AS SELECT (~ t_0.p_partkey) AS col_0, t_0.p_comment AS col_1, t_0.p_brand AS col_2 FROM part AS t_0 JOIN m1 AS t_1 ON t_0.p_comment = t_1.col_0 GROUP BY t_0.p_brand, t_0.p_comment, t_0.p_partkey HAVING ((SMALLINT '-1182') = (REAL '373'));
