CREATE MATERIALIZED VIEW m9 AS SELECT (split_part(hop_0.name, hop_0.name, ((SMALLINT '349') / (SMALLINT '153')))) AS col_0, hop_0.credit_card AS col_1 FROM hop(person, person.date_time, INTERVAL '60', INTERVAL '4260') AS hop_0 WHERE false GROUP BY hop_0.extra, hop_0.id, hop_0.credit_card, hop_0.name;
